 <p>We gladly welcome small groups who wish to serve at Alpha Bitz by: 1) sorting, cleaning, and preparing clothes for display; 2) picking up donations from yard sales or residences (pick-up trucks needed); 3) gathering good-quality furniture and clothing to donate; 4) maintaining grounds; 5) participating in a jail ministry for women; 6) donating skills for repairs and small remodeling projects; 7) using your design and media talents in brochures, flyers, and Web presence; or 8) jail ministry on most Friday afternoons. We will help find the perfect service task for YOU! Ask us about an easy way for your small group to participate in the 400/$21 Hope Partnership.</p>', NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Buffy', ' Russell', NULL, NULL, 'ouralphahouse@gmail.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '865-730-6323', NULL, NULL, NULL, NULL, NULL, 'http://ouralphahouse.org', '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sunday', '0', NULL, '2017-03-06 16:58:03', '2017-03-06 16:58:03', '4c9361b3-091b-4b86-9396-17d84874a88c'),
 ('56', '62', 'en_us', 'Habitat for Humanity of Knoxville', '<p>When most people think about volunteering for Knoxville Habitat for Humanity the image that comes to mind is one of building houses. Sure, construction is the most visible part of our mission, but we have so many more ways that individuals and groups can give of their time. In whatever capacity they decide to share their talents, our volunteers choose the amount of time they want to give. Some work once a month, some twice a week. It’s up to each individual volunteer. And you don’t have to be experienced to fill any volunteer position. On the construction site, we don’t require any prior knowledge of construction for most volunteer positions. Volunteering with Knoxville Habitat for Humanity is a way to learn new skills, to meet new people, and most importantly, to help a deserving family achieve the dream of home-ownership.</p>', NULL, 'Knoxville', NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Trinity', ' Edgar', NULL, NULL, 'tedgar@khfh.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', '865-523-3539', NULL, NULL, NULL, NULL, NULL, 'http://www.knoxvillehabitatforhumanity.com', '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Sunday', '0', NULL, '2017-03-06 16:58:03', '2017-03-06 16:58:03', 'da44948a-43de-46d4-8128-0c4aa140f697'),
 ('57', '63', 'en_us', 'Meet Our Staff', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, 'We\'d love for you to get to know the people who lead our church on the weekends and throughout the week. We\'re passionate about serving our city and surrounding areas for the glory of God\'s Kingdom.', NULL, NULL, 'Sunday', '0', NULL, '2017-03-10 16:31:21', '2017-08-24 20:21:17', '2576a96d-1c57-4918-a668-718d4e3989b5'),
