 ('127', '177', 'en_us', 'Dr. Chris Stephens', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Chris', 'Stephens', 'Senior Pastor', '<p>Pastor Chris was born in Chattanooga, Tennessee to teen parents who split up when he was only three.</p>\n\n<p>By the age of 22 he was a heavy drug user and dealer. Later that year, Chris woke up in a hospital room after a drug overdose and made a decision to connect with God. This decision was especially amazing since neither Chris nor his family had ever attended church.</p>\n\n<p>Over the next 26 years Chris has been serving God as a speaker and a pastor. He has had the opportunity to speak all over the world and has impacted tens of thousands of lives.</p>\n\n<p>Pastor Chris has written a biographical look at his life and the transformation that took place. The book is called The Climb of Your Life. Chris said if his life could transition from the project to the pulpit; from a life of devastation to an amazing destiny, then so can any life.</p>\n\n<p>As the Senior Pastor of Generic Church Church, he has seen thousands find hope and fulfillment in their destiny. Chris says his purpose is to help people recognize and achieve their full potential. He came so close to death and missing all God had for him he now wants to help others find the same purpose in their lives that he has found.</p>\n\n<p>Pastor\'s blog and information about his book can be found at <a href=\"http://drchrisstephens.com\">DrChrisStephens.com</a>.</p>\n\n<p>You can also connect with Pastor Chris via <a href=\"http://facebook.com/pastorchris\">Facebook</a> and <a href=\"http://twitter.com/drchrisstephens\">Twitter</a>.</p>', 'Pastor@faithpromise.org', '2000', 'pastorchris', 'drchrisstephens', 'drchrisstephens', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', '0', NULL, '2017-09-01 16:41:09', '2017-09-01 18:23:51', '34cbb6e8-47b4-4310-9656-7d97451377dc'),
 ('128', '178', 'en_us', 'Randy Riggins', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Randy', 'Riggins', 'High School Pastor', '<p>I have been at FPC since October 2006, and I have been in full time student ministry since 1992.</p>\n\n<p>I enjoy hanging out with my family - wife: Holly, and kids: Shaelee (7), Rylee (5), and Silas (2). I also enjoy running early in the morning (I know, sick huh?) and reading.  Actually, most of my free time gets divided between being an unbelievable husband, watching Rylee annihilate the competition in soccer, attempting to finally beat Shaelee in most any card game, and engaging in deep theological and philosophical debates with Silas.</p>\n\n<p>One unusual thing about me:  In high school, I played a drum major in a chase scene of a made-for-TV movie.</p>\n\n<p>I grew up most of my life in Texas, but I’ve also worked in youth ministry in Oklahoma and Louisiana.</p>\n\n<p>Mexican food is my favorite food group, but a great steak dinner is hard to beat.</p>\n\n<p>I enjoy listening to Passion Worship artists (like Crowder and Tomlin), and students enjoy giving me a hard time about enjoying the music of 80’s artists like Charlie Peacock and Steve Taylor.</p>\n\n<p>I graduated from Baylor University with a BA in Communications, and received my Masters in Religious Education from Southwestern Baptist Theological Seminary.</p>\n\n<p>I am also a partner with Reach Out Youth Solutions in coaching and mentoring youth pastors/workers both nationally and internationally.</p>', 'RandyR@faithpromise.org', '1301', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', '0', NULL, '2017-09-01 16:41:10', '2017-09-01 18:23:52', 'f1919a97-3577-44d6-8ff3-93cc9ac2a328'),
 ('129', '179', 'en_us', 'Art Jensen', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Art', 'Jensen', 'Pastor of Group Ministries', '<p><strong>How long have you been at Generic Church?</strong><br />I was born and raised in San Diego CA.  I am married and have four Children; two boys and two girls.  Before moving to Tennessee I spent four years in Denver.</p>\n\n<p><strong>When did you come on staff?</strong><br />I have been on staff at Generic Church since June of ’07.</p>\n\n<p><strong>What’s your favorite hobby?</strong><br />I love sports. My favorite to watch is pro football.  My favorite team is the San Diego Chargers.  And my favorite sport to play is surfing; although the surf in Tennessee is not that great, I will keep trying.</p>\n\n<p><strong>What is something unusual about you?</strong><br />I have a twin brother…</p>\n\n<p><strong>If you could be any animal, what would it be?</strong><br />If I could be any animal, I would be hmmmm… human.  Okay, how about a sheep?  That way I could spend all day with the “Shepherd”. Okay, okay… I would be an eagle, I think it would be cool to be able to fly.</p>\n\n<p><strong>Your favorite food, least favorite food, greatest fear, most embarrassing moment, or nickname growing up.</strong><br />My favorite food is probably steak and potatoes, but I also really like Mexican food, come to think of it, I really like food. My least favorite is shellfish. I am allergic.  My most embarrassing moment is now writing this bio.\n… And my nickname growing up,… you will have to ask my wife,… and she\'d better not tell you.</p>', 'ArtJ@faithpromise.org', '1401', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', '0', NULL, '2017-09-01 16:41:10', '2017-09-01 18:23:52', 'f59914f7-74cd-47c0-a872-e8006db64868'),
 ('131', '181', 'en_us', 'Gloria Petrowski', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Gloria', 'Petrowski', 'Assistant to the Senior Pastor', '<p>I was born in Oak Ridge and have never lived anywhere else. I was raised in a loving Christian home and was saved and baptized at the age of nine. I have one younger sister, Lisa, who lives in Snellville, GA. My parents are both deceased.</p>\n\n<p>I have been married to my awesome husband, Larry, for 36 years. God blessed us with two wonderful children - Justin, 27 and Jenna, 24 - and their equally wonderful spouses - Kara, 26 and Ben, 25. We all serve the Lord here together in various ways in the Worship Ministry of Generic Church. I began singing in the Cherub Choir at the age of three and have been singing since that time!</p>\n\n<p>I was the first employee hired here when Generic Church began in 1995. I worked first in finance and membership and then became Pastor Chris\' personal assistant when he joined us in 1996. What a joy it is to serve alongside him and to see all the many miracles God continues to perform here!</p>\n\n<p>I enjoy walking, boating, reading, and especially traveling. If someone says \"go\", I am always ready! I love hot chocolate-chip cookies and don\'t like greens! I don\'t like heights, but through the years I have learned to conquer that fear somewhat. My nickname growing up was Glory or Gloworm and I can speak pig-Latin really fast!</p>', 'GloriaP@faithpromise.org', '2000', 'gloria.petrowski', 'gfpetrowski', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', '0', NULL, '2017-09-01 16:41:13', '2017-09-01 18:23:59', 'dc30c1ea-ea41-4cc4-aa0f-d5fcffb86f0e'),
 ('133', '183', 'en_us', 'Marti Willen', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Marti', 'Willen', 'First Impressions & Facilities Director', '<p>I came on staff in 2007, and I absolutely love working at FPC! I have a fantastic life, thanks to my awesome husband, Tim, and our boys, Jacob and Caleb. I love hanging out with my family, reading, singing, and most of all, I love laughing. FP has given me more opportunities than I could have ever dreamed of, and I am so grateful that God led me to a place where He is constantly moving.</p>', 'MartiW@faithpromise.org', '1703', NULL, 'mwillen', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', '0', NULL, '2017-09-01 16:41:16', '2017-09-01 18:24:03', '855bd006-ad96-4c7d-bcae-d7a73ec4e899'),
 ('134', '184', 'en_us', 'Jayne Bass', NULL, NULL, NULL, NULL, NULL, NULL, '0.00000', '0.00000', NULL, 'Jayne', 'Bass', 'Children\'s Services Coordinator', NULL, 'JayneB@faithpromise.org', '1402', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '0', 'both', NULL, NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '7', '0', NULL, '2017-09-01 16:41:16', '2017-09-01 18:24:03', '6bc5a263-05a3-4441-9227-ed030410235b');



